/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `GET_SESSION_STATS`(IN `_limit` int)
BEGIN
    PREPARE stmt FROM "
      SELECT CONCAT(`country`, ' [', `ip`, ']') AS `visitor`, `count`, `timestamp`
      FROM `stats_session`
      WHERE `timestamp` >= DATE(NOW()) - INTERVAL 1 WEEK
        AND `ip` <> '127.0.0.1'
