/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `GET_TAGS`(IN `_limit` int)
BEGIN
    PREPARE stmt FROM "
			SELECT t.*, COUNT(pt.`id`) `count`
			FROM `tags` t
			JOIN `post_tags` pt ON pt.`tag_id` = t.`id`
			GROUP BY t.`id`
